import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

import "./Project.css";

const Project = () => {
  const [selectedFile, setSelectedFile] = useState(null);

  const files = [
    { name: 'Cloudera Architecture_Image', type: 'image', path: 'acfc/public/cloudera architecture.png' },
    { name: 'Data and Analytics Migration to Cloud w_Hexaware Video', type: 'video', path: 'https://hexawareonline.sharepoint.com/teams/ACFCAmeriHealthInduction/_layouts/15/stream.aspx?id=%2Fteams%2FACFCAmeriHealthInduction%2FShared%20Documents%2FGeneral%2F01%20ACFC%20Overview%2FDL%202%2E0%20Migration%20Project%2FData%20and%20Analytics%20migration%20to%20Cloud%20w_Hexaware%20%28Discovery%20workshop%29-20220310_122107-Meeting%20Recording%2Emp4&referrer=SharePoint&referrerScenario=OpenFile' },
    { name: 'Datalake 2.0 Architecture_Image', type: 'image', path: 'acfc/public/DataLake2.0 Architecture.png' },
    { name: 'Hexaware_Datalake Initiative_PPT', type: 'ppt', path: 'https://hexawareonline.sharepoint.com/:p:/r/teams/ACFCAmeriHealthInduction/Shared%20Documents/General/01%20ACFC%20Overview/DL%202.0%20Migration%20Project/Hexaware_AmeriHealth_Data%20Lake%20Initiative_v0.2.pptx?d=wc0b0a6c4ff4e4c658c8e6dcb39e631d6&csf=1&web=1&e=c0g33G' },
    { name: 'Amerihealth_Data Migration to cloud_Pdf', type: 'pdf', path: '/data_migration.pdf' },
    { name: 'Hexaware_Q&A_client clarification_excel ', type: 'excel', path: 'https://hexawareonline.sharepoint.com/:x:/r/teams/ACFCAmeriHealthInduction/Shared%20Documents/General/01%20ACFC%20Overview/DL%202.0%20Migration%20Project/Hexaware_Q%26A_Client_Clarification_w_response.xlsx?d=wbb73fcb0a1d64281af8feb12d21205a7&csf=1&web=1&e=lqrNoE' },
    { name: 'High level data lake 2.0_Requirements_Pdf', type: 'pdf', path: '/requirements.pdf' },
    { name: 'SOW_AMerihealth Data lake Migration_word', type: 'word', path: '/migration.docx' }
  ];

  const handleFileDisplay = (path) => {
    // window.open(path, '_blank');
    window.location.href = path;
  };
  

  return (
    <div className="container">
      {files.map((file, index) => (
        // <button key={index} className="button" onClick={() => handleFileDisplay(file.path)}>
        //   {file.name}
        // </button>
        <button key={index} className="button" onClick={() => handleFileDisplay(file.path)}>
  {file.name}
</button>

      ))}
      {selectedFile && (
        <div className="file-container">
          {/* Display the selected file based on its type */}
          {selectedFile.endsWith('.png') && <img className="file-display" src={selectedFile} alt="File" />}
          {selectedFile.endsWith('.pptx') && <iframe className="file-display" src={selectedFile} title="File" />}
          {selectedFile.endsWith('.pdf') && <iframe className="file-display" src={selectedFile} title="File" />}
          {selectedFile.endsWith('.docx') && <iframe className="file-display" src={selectedFile} title="File" />}
          {selectedFile.endsWith('.xlsx') && <iframe className="file-display" src={selectedFile} title="File" />}
          {selectedFile.endsWith('.video') && (
            <video className="file-display" src={selectedFile} controls>
              Your browser does not support the video tag.
            </video>
          )}
        </div>
      )}
    </div>
  );
};


export default Project;
